import React, { useState } from 'react';

const Tour = ( {tours} ) => {
  return (
    <section>
      <div className='title'>
        <h2> Our tours</h2>
        <div className='underline'></div>
      </div>

      <div>
        {tours.map((tour) => {
          return <Tour key={tour.id} {...tour} ></Tour>
        })
        }
      </div>
    </section>
  )
};

export default Tour;
